import logo from './image/logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <img src={logo} alt="BigCo Inc. logo"/>
        <p>
          Website đang trong quá trình xây dựng.
      Xin vui lòng quay lại sau.</p>

      </header>
    </div>
  );
}

export default App;
